import React from 'react'
import './Topbar.css';
import { Link } from 'react-router-dom';

 const topbar = () => {
     const user = false;
    return (
        <div className="top">
            <div className="topleft"><i className="topIcon fab fa-blogger-b"></i></div>
            <div className="topcenter">
                <ul className="toplist">
                    <li className="toplistitem" > <Link className="link" to="/home">HOME</Link></li>
                    <li className="toplistitem"> <Link className="link" to="/home">ABOUT</Link></li>
                    <li className="toplistitem"> <Link className="link" to="/home">CONTACT ME</Link></li>
                    <li className="toplistitem"> <Link className="link" to="/home">POST</Link></li>
                    
                </ul>

            </div>
            <div className="topright">
                <ul className="toptightlist">
                    <li className="toptightlistitem"> {user && "Logout"}</li>
                    {/* <li className="toptightlistIcon"> {!user && <i class="fa fa-user" aria-hidden="true"></i>}</li> */}
                    

                </ul>
            </div>
        </div>
    )
}

export default topbar;
